import './App.css';
import React from "react";
import axios, {Axios} from "axios";

import UserList from "./components/User.js";


class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            'users': []
        }
    }

    componentDidMount() {
        // const users = [
        //     {
