        //     {
        //         'username': 'Alex_1',
        //         'first_name': 'alex_1',
        //         'last_name': 'geek_1',
        //         'email': 'test_1@gmail.com',
        //     },
        // ]
        axios.get('http://127.0.0.1:8000/api/userapp/').then(response => {
            const users = response.data
            this.setState({
                    'users': users
                }
            )
        }).catch(error => {
            console.log(error)
        })
    }

    render() {
        return (
            <div>
                < UserList users={this.state.users}/>
            </div>
        )
    }
}

export default App;
